import { TogetherModel } from "../models/togetherModel";
import {
  ModelConfig,
  ContentType,
  RoleType,
  MessageType,
  UserRequestMessage,
  ModelProvider,
} from "../types";
import { randomUUID } from "crypto";
import { config } from "dotenv";

config();

// Test configuration for Llama 4
const testConfig: ModelConfig = {
  // modelName: "meta-llama/Llama-3.2-11B-Vision-Instruct-Turbo",
  // modelName: "meta-llama/Llama-4-Scout-17B-16E-Instruct",
  modelName: "meta-llama/Llama-4-Maverick-17B-128E-Instruct-FP8",
  modelProvider: ModelProvider.TOGETHER,
  temperature: 0.7,
  maxTokens: 1000,
  inputCost: 0.0000018, // $0.0018 per 1k tokens
  outputCost: 0.0000018, // $0.0018 per 1k tokens
};

async function testTogetherWithImage() {
  console.log("üöÄ Testing Together AI Llama 4 with image input...");

  // Check if API key is set
  if (!process.env.TOGETHER_API_KEY) {
    console.error("‚ùå TOGETHER_API_KEY environment variable is not set");
    process.exit(1);
  }

  try {
    // Initialize the model
    const model = new TogetherModel(testConfig);
    console.log("‚úÖ Model initialized successfully");

    // Create a test image (you can replace this with your own image)
    const testImageBase64 = createTestImage();

    // Create a test message with both text and image
    const testMessage: UserRequestMessage = {
      id: randomUUID(),
      timestamp: Date.now(),
      role: RoleType.USER,
      type: MessageType.USER_REQUEST,
      content: [
        {
          type: ContentType.TEXT,
          text: "What do you see in this image? Please describe it in detail.",
        },
        {
          type: ContentType.IMAGE,
          data: testImageBase64,
          mimeType: "image/png",
        },
      ],
    };

    console.log("üìù Test message created with text and image content");

    // Format the request
    const formattedMessages = model.formatRequest([testMessage]);
    console.log("üîÑ Request formatted for Together AI");

    // Generate response
    console.log("ü§ñ Generating response...");
    const response = await model.generateResponse(formattedMessages);

    // Display results
    console.log("\nüéâ Response received!");
    console.log("üìä Response details:");
    console.log(`- Model: ${response.model}`);
    console.log(
      `- Created: ${new Date(response.created * 1000).toISOString()}`
    );
    console.log(`- Finish reason: ${response.choices[0].finish_reason}`);

    if (response.usage) {
      console.log("üí∞ Usage:");
      console.log(`- Prompt tokens: ${response.usage.prompt_tokens}`);
      console.log(`- Completion tokens: ${response.usage.completion_tokens}`);
      console.log(`- Total tokens: ${response.usage.total_tokens}`);

      const cost = model.getCostFromResponse(response);
      console.log(`- Estimated cost: $${cost.toFixed(6)}`);
    }

    console.log("\nüìù Assistant response:");
    console.log(response.choices[0].message!.content);

    // Test with tools as well
    // await testWithTools(model);
  } catch (error) {
    console.error("‚ùå Test failed:", error);
    process.exit(1);
  }
}

async function testWithTools() {
  console.log("\nüõ†Ô∏è  Testing with tools...");
  const model = new TogetherModel(testConfig);
  console.log("‚úÖ Model initialized successfully");

  // Create a simple test tool
  const testTools = [
    {
      name: "get_weather",
      description: "Get current weather information for a location",
      inputSchema: {
        type: "object" as const,
        properties: {
          location: {
            type: "string",
            description: "The city and state, e.g. San Francisco, CA",
          },
          unit: {
            type: "string",
            enum: ["celsius", "fahrenheit"],
            description: "Temperature unit",
          },
        },
        required: ["location"],
      },
    },
  ];
  const testImageBase64 = createTestImage();

  const testMessage: UserRequestMessage = {
    id: randomUUID(),
    timestamp: Date.now(),
    role: RoleType.USER,
    type: MessageType.USER_REQUEST,
    content: [
      {
        type: ContentType.TEXT,
        // text: "What's the weather like in San Francisco? Please use the weather tool to get current information.",
        text: "What do you see in the image attached in the content? Please describe it in detail.",
      },
      {
        type: ContentType.IMAGE,
        data: testImageBase64,
        mimeType: "image/png",
      },
    ],
  };

  const formattedMessages = model.formatRequest([testMessage]);
  const formattedTools = model.formatToolList(testTools);

  try {
    const response = await model.generateResponseWithTool(
      formattedMessages,
      formattedTools
    );

    console.log("‚úÖ Tool response received");
    console.log("üîß Tool calls:");

    const toolCalls = model.formatCallToolRequest(response);
    if (toolCalls.length > 0) {
      toolCalls.forEach((call, index) => {
        console.log(
          `  ${index + 1}. ${call.name}(${JSON.stringify(call.arguments)})`
        );
      });
    } else {
      console.log("  No tool calls made");
    }

    console.log("\nüìù Assistant response with tools:");
    console.log(response.choices[0].message!.content);
  } catch (error) {
    console.log("‚ö†Ô∏è  Tool test failed (this might be expected):", error);
  }
}

function createTestImage(): string {
  const redPixelPNG =
    "data:image/png;base64,";

  return redPixelPNG;
}

// Run the test
if (require.main === module) {
  testTogetherWithImage()
    .then(() => {
      console.log("\nüéâ All tests completed successfully!");
      process.exit(0);
    })
    .catch((error) => {
      console.error("\n‚ùå Test suite failed:", error);
      process.exit(1);
    });
}

export { testTogetherWithImage };
